import { RepoItem } from "components";
import { IRepositoryItem } from "interfaces";

interface IProps {
  repos: IRepositoryItem[];
}

const SearchResult: React.FC<IProps> = ({ repos }) => {
  return (
    <>
      {repos.map((item) => {
        return (
          <RepoItem full_name={item.full_name} description={item.description} />
        );
      })}
    </>
  );
};

export default SearchResult;
